import axios from "axios";
import { Component } from "react";

const Home = () => {
  return (
    <>
      <h2>Home</h2>
      {axios.get("http://localhost:5000/marcacoes").then((res) => {
        console.log(res);
      })}
    </>
  );
};

export default Home;
